Julia Fiona Roberts (born October 28, 1967) is an Academy Award-winning American film actress and former fashion model. She shot to fame during the early 1990s after starring in the romantic comedy Pretty Woman opposite Richard Gere, which grossed US $463 million worldwide. She won the Best Actress Academy Award in 2001 for her critically acclaimed turn as the title character in Erin Brockovich and earned Oscar nominations as Best Supporting Actress for Steel Magnolias (1989) and Best Actress for Pretty Woman (1990). Her films, which also include The Pelican Brief, My Best Friend&amp;#039;s Wedding, Mystic Pizza, Notting Hill, Runaway Bride, and Ocean&amp;#039;s Eleven, have collectively earned box office receipts well over US$2 billion.
